import React from "react";
// import "./style/nav.css";
import { SideNav, NavLinks } from "./Common.js";
import Auth from "../../utils/auth.js";
import { NavLink } from "react-router-dom";

function sideNav() {
  const logout = (event) => {
    event.preventDefault();
    Auth.logout();
  };
  const page = (event) => {
    event.preventDefault();
  }

  return (
    <SideNav>
      <NavLinks>
        <Link onClick={page} href="/explore">Home</Link>

        <Link onClick={page} href="/about">About</Link>

        {Auth.loggedIn() ? (
          <>
            <Link onClick={page} href="/profile">Profile</Link>
            <Link onClick={logout} href="/">
              Logout
            </Link>
          </>
        ) : (
          <Link href="/">Login</Link>
        )}
      </NavLinks>
    </SideNav>
  );
};

export default sideNav;
